from typing import List
from collections import deque

class Solution:
    def solve(self, board: List[List[str]]) -> None:
        """
        Do not return anything, modify board in-place instead.
        """
        def bfs(r, c):
            dq = deque()
            dq.append((r, c))
            while dq:
                size = len(dq)
                for _ in range(size):
                    row, col = dq.popleft()
                    for dr, dc in directions:
                        rnew = row + dr
                        cnew = col + dc
                        if 0 <= rnew < rows and 0 <= cnew < cols and board[rnew][cnew] == 'O':
                            board[rnew][cnew] = 'K'
                            dq.append((rnew, cnew))
        rows = len(board)
        cols = len(board[0])
        directions = [(0,1), (1,0), (0,-1), (-1,0)]
        for r in range(rows):
            for c in range(cols):
                # BFS only from edge cells
                if r == 0 or r == rows-1 or c == 0 or c == cols-1:
                    if board[r][c] == 'O':
                        board[r][c] = 'K'  # K = Keep this cell as is
                        bfs(r, c)
        for r in range(rows):
            for c in range(cols):
                if board[r][c] == 'O':
                    board[r][c] = 'X'
                elif board[r][c] == 'K':
                    board[r][c] = 'O'
        print(f'board = {board}')

